import { GET_MYPROFILE_RES } from '../ActionType'
const initialstate = []
export const myProfileReducer = (state = initialstate, action) => {

    switch (action.type) {
        case GET_MYPROFILE_RES:
            return {
                myProfileuserId: action.payload

            }



        default:
            return state;
    }


}
